!function(t){try{t=angular.module("app.tpl")}catch(a){t=angular.module("app.tpl",[])}t.run(["$templateCache",function(t){t.put("/main/partials/drug-detail.html",'<div class="container"><div class="col-sm-12"><div class="page-header"><h1>{{ drug }}</h1><a class="btn btn-default" data-ng-href="/"><i class="icon-arrow-left"></i> Back</a> <a class="btn btn-default" ng-click="toggleFollow()"><span ng-if="!following">Follow</span> <span ng-if="following">Unfollow</span></a></div><div>{{drugDetails}}</div></div></div>')}])}(),function(t){try{t=angular.module("app.tpl")}catch(a){t=angular.module("app.tpl",[])}t.run(["$templateCache",function(t){t.put("/main/partials/main-index.html",'<div class="container"><div class="row"><div class="col-sm-12"><div class="page-header"><h1>Hello main-index!</h1></div></div></div><div class="row"><div class="col-sm-6"><label for="selectDrugInput">Search for medications by name</label><ui-select id="selectDrugInput" class="ui-select-scroll ui-select-auto-width ui-select-opaque" theme="bootstrap" data-ng-model="drug.selected" search-enabled="true" reset-search-input="true"><ui-select-match>{{$select.selected}}</ui-select-match><ui-select-choices repeat="drug as drug in drugs | filter: $select.search">{{drug}}</ui-select-choices></ui-select></div></div><div class="row" style="padding-top: 15px;"><div class="col-sm-6"><div ng-repeat="drug in followedDrugs" class="well" data-ng-class="highlightClass(drug)">{{ drug.name }}</div></div></div></div>')}])}(),function(t){try{t=angular.module("app.tpl")}catch(a){t=angular.module("app.tpl",[])}t.run(["$templateCache",function(t){t.put("/other/partials/main.html",'<div class="container"><div class="col-sm-12"><div class="page-header"><h1>Hello Other!</h1></div><a class="btn btn-default" href="/">Go to main-index!</a></div></div>')}])}(),function(t){try{t=angular.module("app.tpl")}catch(a){t=angular.module("app.tpl",[])}t.run(["$templateCache",function(t){t.put("/pattern/partials/main.html",'<div class="container"><div class="row pl"><div class="col-sm-9"><h1>Pattern Libaray</h1><h2 id="colorswatch">Color Swatch<div class="pl-example"><div class="pl-color-swatch pl-color-swatch-white"></div><div class="pl-color-swatch pl-color-swatch-black"></div><div class="pl-color-swatch pl-color-swatch-light-blue"></div><div class="pl-color-swatch pl-color-swatch-dark-blue"></div><div class="pl-color-swatch pl-color-swatch-light-red"></div><div class="pl-color-swatch pl-color-swatch-light-yellow"></div><div class="pl-color-swatch pl-color-swatch-light-green"></div><div class="pl-color-swatch pl-color-swatch-light-gray"></div><div class="pl-color-swatch pl-color-swatch-dark-gray"></div></div><h2 id="typography">Typography</h2><p id="typographyheading">All HTML headings, <code>&lt;h1&gt;</code> through <code>&lt;h6&gt;</code>, are available. <code>.h1</code> through <code>.h6</code> classes are also available, for when you want to match the font styling of a heading but still want your text to be displayed inline.</p><div class="pl-example"><h1>h1. heading</h1><h1>Drug Name : aBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789</h1><h2>h2. heading</h2><h2>AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789</h2><h3>h3. heading</h3><h3>AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789</h3><h4>h4. heading</h4><h4>AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789</h4><h5>h5. heading</h5><h6>h6. heading</h6><h6>AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789</h6></div><h3 id="typographybody">Body Copy</h3><p>The global default <code>font-size</code> is <strong>20px</strong>, with a <code>line-height</code> of <strong>1.5 em</strong>. This is applied to the <code>&lt;body&gt;</code> and all paragraphs. In addition, <code>&lt;p&gt;</code> (paragraphs) receive a bottom margin of half their computed line-height (10px by default).</p><div class="pl-example"><p>Paragraph</p><p>Nullam quis risus eget urna mollis ornare vel eu leo. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Nullam id dolor id nibh ultricies vehicula.</p><p>Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec ullamcorper nulla non metus auctor fringilla. Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit. Donec ullamcorper nulla non metus auctor fringilla.</p><p>Maecenas sed diam eget risus varius blandit sit amet non magna. Donec id elit non mi porta gravida at eget metus. Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit.</p></div><h3 id="typographytitle">Title</h3><p>Title and subtitle, are available by way of <code>title</code> mixin.</p><div class="pl-example"><div class="title"><div class="title">Title</div></div><div class="title"><div class="subtitle">Subtitle</div></div></div><h2 id="buttons">Buttons</h2><h3 id="buttonbasic">Basic</h3><p>Use the button classes on an anchor, button, or input element.</p><div class="pl-example"><button type="button" class="btn btn-link">View All</button> <button class="btn btn-default" type="submit">Button</button> <input class="btn btn-default" type="button" value="Input"> <input class="btn btn-default" type="submit" value="Submit"></div><div class="pl-code-sample"><pre>\n					<code>\n                        <span class="pl-syntax-html">btn btn-link</span>\n                        <span class="pl-syntax-html">btn btn-default</span>\n                    </code>\n				</pre></div><h3 id="buttonclass">Class</h3><p>Use any of the available button classes to quickly create a styled button.</p><div class="pl-example"><button type="button" class="btn btn-default">Default</button> <button type="button" class="btn btn-default-alt">Default Alt</button><button type="button" class="btn btn-primary">Primary</button><button type="button" class="btn btn-primary-alt">Primary Alt</button><button type="button" class="btn btn-success">Success</button><button type="button" class="btn btn-info">Info</button><button type="button" class="btn btn-warning">Warning</button><button type="button" class="btn btn-danger">Danger</button><button type="button" class="btn btn-link">Link</button><button type="button" class="btn btn-text">Link</button></div><div class="pl-code-sample"><pre>\n					<code>\n                        <span class="pl-syntax-comment">btn btn-default</span>\n                        <span class="pl-syntax-comment">btn btn-default-alt</span>\n                        <span class="pl-syntax-comment">btn btn-primary</span>\n                        <span class="pl-syntax-comment">btn btn-primary-alt</span>\n                        <span class="pl-syntax-comment">btn btn-info</span>\n                        <span class="pl-syntax-comment">btn btn-warning</span>\n                        <span class="pl-syntax-comment">btn btn-danger</span>\n                        <span class="pl-syntax-comment">btn btn-link</span>\n                    </code>\n				</pre></div><h3 id="buttonclass">Class Alts</h3><p>Use any of the available button classes to quickly create a styled button.</p><div class="pl-example"><button type="button" class="btn btn-default skinny">Default</button> <button type="button" class="btn btn-default-alt skinny">Default Alt</button><button type="button" class="btn btn-primary skinny">Primary</button><button type="button" class="btn btn-primary-alt skinny">Primary Alt</button><button type="button" class="btn btn-success skinny">Success</button><button type="button" class="btn btn-info skinny">Info</button><button type="button" class="btn btn-warning skinny">Warning</button><button type="button" class="btn btn-danger skinny">Danger</button><button type="button" class="btn btn-link skinny">Link</button><button type="button" class="btn btn-text skinny">Link</button></div><div class="pl-code-sample"><pre>\n					<code>\n                        <span class="pl-syntax-comment">btn btn-default skinny</span>\n                        <span class="pl-syntax-comment">btn btn-default-alt skinny</span>\n                        <span class="pl-syntax-comment">btn btn-primary skinny</span>\n                        <span class="pl-syntax-comment">btn btn-primary-alt skinny</span>\n                        <span class="pl-syntax-comment">btn btn-info skinny</span>\n                        <span class="pl-syntax-comment">btn btn-warning skinny</span>\n                        <span class="pl-syntax-comment">btn btn-danger skinny</span>\n                        <span class="pl-syntax-comment">btn btn-link skinny</span>\n                    </code>\n				</pre></div><h3 id="buttontag">Tags</h3><p>Join available button classes and icon fonts to create a styled button.</p><div class="pl-example"><a class="btn btn-default-alt btn-prev" href="#"><i id="icon-arrow-left" class="icon-arrow-left"></i> <span class="btn-prev-label">Back</span></a></div><div class="pl-code-sample"><pre>\n					<code>\n                        <span class="pl-syntax-comment">btn-default-alt btn-prev icon-arrow-left</span>\n                    \n                    </code>\n				</pre></div><h2 id="forms">Forms</h2><h3>Basic</h3><p>Individual form controls automatically receive some global styling. All textual <code>&lt;input&gt;</code>, <code>&lt;textarea&gt;</code>, and <code>&lt;select&gt;</code> elements with <code>.form-control</code> are set to <code>width: 100%;</code> by default. Wrap labels and controls in <code>.form-group</code> for optimum spacing.</p><p>Form elements with <code>&lt;select&gt;</code> require <code>&lt;button&gt;</code> and ui-select.</p><div class="pl-example pl-ui-select"><div><form><ul class="intake-question-list"><p class="type-gray type-small">Select elements use ui-select to provide a typeahead dropdown. To force a visible scrollbar on select choices add <code>&lt;ui-select-scroll&gt;</code>. Since select elements are created with ui-select, <code>&lt;class="ui-select-scroll"&gt;</code> and <code>&lt;theme="bootstrap"&gt;</code> must be made available to the element.</p><li class="example"><span class="intake-question-label">What is the meaning of life?</span> <span class="help-block">This is some helper text</span><ui-select name="example_select" data-ng-model="uiSelect.selected" theme="bootstrap" ng-change="updateVisible(question)" class="ui-select-scroll"><ui-select-match placeholder="Please Select">Please Select</ui-select-match><ui-select-choices repeat="option in options | filter: $select.search"><div data-ng-bind-html="option.indy | highlight: $select.search"></div></ui-select-choices></ui-select></li></ul></form></div></div></h2></div><div class="col-sm-3"><div id="navbar"><ul class="nav" role="tablist"><li><a href="#/pattern/#iconfonts">Icon Fonts</a></li><li><a href="#/pattern/#colorswatch">Color Swatch</a><ul><li><a href="#/pattern/#colorswatchoption">Options</a></li></ul></li><li><a href="#/pattern/#typography">Typography</a><ul><li><a href="#/pattern/#typographyheading">Heading</a></li><li><a href="#/pattern/#typographybody">Body</a></li><li><a href="#/pattern/#typographytitle">Title</a></li></ul></li><li><a href="#/pattern/#buttons">Buttons</a><ul><li><a href="#/pattern/#buttonbasic">Basic</a></li><li><a href="#/pattern/#buttonclass">Class</a></li><li><a href="#/pattern/#buttontag">Tag</a></li></ul></li><li><a href="#/pattern/#forms">Forms</a></li></ul></div></div></div></div>')}])}();